void CompareInterpolation(map<string, vector<vector<MatrixXd>>> expected, map<string, vector<vector<MatrixXd>>> actual) 
{
	int count0 = 0;
	if (expected.size() != actual.size())
		wcout << "map sizes incorrect" << endl;
	for (auto itemE : expected)
	{
		auto vvecE = itemE.second;
		//check key same
		auto vvecA = actual[itemE.first];
		if (itemE.second.size() != vvecA.size())
			wcout << "vector<vector<>> " << count0 << " sizes incorrect. " << itemE.second.size() << " vs "<< vvecA.size() << endl;
		int count1 = 0;
		for (auto vecE : vvecE)
		{

			int count2 = 0;
			auto vecA = vvecA[count1];
			if (vecE.size() != vecA.size())
				wcout << "vector<> " << count1 << " sizes incorrect. " << vecE.size() << " vs " << vecA.size() << endl;

			for (auto mE : vecE)
			{
				cout << "checking key:\'" << itemE.first << "\' vector<> " << count1 << " matrix:" << count2 << endl;
				auto mA = vecA[count2];
				Common::checkMatrix(mE, mA, 0.0000000001);
				count2++;
			}
			count1++;

		}
		count0++;

	}
};

